import React, { useEffect } from "react";
import styles from "./ContactUs.module.scss";
import svs from "../../../../assets/blogImages/svslogo.jpg";
import teamslogo from "../../../../assets/blogImages/team9logo.jpg";
import bhonchesaraLogo from "../../../../assets/blogImages/bhonchesara.webp";
import "bootstrap/dist/css/bootstrap.min.css";

const ContactUs = () => {
  useEffect(() => {
    // Show cards with delay
    const showCards = () => {
      setTimeout(() => {
        document.getElementById("card1").style.opacity = "1";
        document.getElementById("card1").style.transform = "translateY(0)";
      }, 500);

      setTimeout(() => {
        document.getElementById("card2").style.opacity = "1";
        document.getElementById("card2").style.transform = "translateY(0)";
      }, 1000);

      setTimeout(() => {
        document.getElementById("card3").style.opacity = "1";
        document.getElementById("card3").style.transform = "translateY(0)";
      }, 1500);
    };

    showCards();
  }, []);

  return (
    <div>
   <div className={styles.helpSectionContainer}>
  <div className={styles.helpSectionContent}>
    <h1 className={styles.helpSectionText}>
      How can we help you?
    </h1>
    <button
      className={styles.contactButton}
      data-bs-toggle="modal"
      data-bs-target="#contactModal"
      aria-labelledby="contactModalLabel"
    >
      Contact Us
    </button>
  </div>
</div>



      {/* Modal */}
      <AppModal />

      <div style={{ backgroundColor: '#f0f1f2' }}>
        <div className="container mt-5">
          <div className="row justify-content-center">
            <div className="container text-center d-flex flex-column align-items-center justify-content-center" style={{ marginTop: 30 }}>
              <h1 className={styles.sectionHeader}>We Are Looking for</h1>
              <span className="text-muted px-3 mt-2" style={{ fontFamily: 'system-ui' }}>
                We are happy to assist you in providing comprehensive services, a dedicated team of professionals who are committed to going the extra mile for you, around the clock, to enhance your experience with unwavering efficiency.
              </span>
            </div>
            <div className="col-md-4 mb-4 mt-4">
              <div
                className={`d-flex flex-column align-items-center justify-content-center p-4 shadow rounded-lg ${styles.projectCard}`}
                id="card1"
              >
                <h6 className={styles.projectName}>Sri SVS Pearls & Jewellers</h6>
                <img className="img-fluid" src={svs} alt="Sri SVS Pearls & Jewellers" />
              </div>
            </div>
            <div className="col-md-4 mb-4 mt-4">
              <div
                className={`d-flex flex-column align-items-center justify-content-center p-4 shadow rounded-lg ${styles.projectCard}`}
                id="card2"
              >
                <h6 className={styles.projectName}>Bhonchesara</h6>
                <img className="img-fluid" src={bhonchesaraLogo} alt="Bhonchesara" />
              </div>
            </div>
            <div className="col-md-4 mb-4 mt-4">
              <div
                className={`d-flex flex-column align-items-center justify-content-center p-4 shadow rounded-lg ${styles.projectCard}`}
                id="card3"
              >
                <h6 className={styles.projectName}>Team 9 Infra</h6>
                <img className="img-fluid" src={teamslogo} alt="Team 9 Infra" />
              </div>
            </div>
          </div>
        </div>

        <div>
          <h1 className={styles.locationText}>Location</h1>
          <div className={`container shadow ${styles.locationContainer}`}>
            <div className="row">
              <div className="col-md-6 d-flex justify-content-center align-items-center">
                <img
                  src="https://thumbs.dreamstime.com/b/famous-hyderabad-landmark-charminar-india-world-built-quli-qutb-shah-th-century-128124667.jpg"
                  alt="Charminar"
                  className={styles.locationImg}
                  style={{ width: '70%', height: '70%' }}
                />
              </div>
              <div className="col-md-6 d-flex flex-column justify-content-center align-items-center">
                <h2 style={{ textAlign: 'center', marginBottom: '20px', marginLeft: -30, fontFamily: 'system-ui' }}>
                  TRISHOKA DIGITAL SERVICES
                </h2>
                <u>
                  <p style={{ textAlign: 'center', color: '#B87333', fontFamily: 'system-ui' }}>
                    Off. No: 1014, 10th Floor, Prajay Princeton Towers, Saroornagar,
                    Doctors Colony, Opp NTR Market, L.B. Nagar, Hyderabad - 500074
                  </p>
                </u>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

// Modal Component
const AppModal = () => (
  <div
    className="modal fade"
    id="contactModal"
    tabIndex="-1"
    role="dialog"
    aria-labelledby="contactModalLabel"
    aria-hidden="true"
  style={{marginTop:'10%'}}
  >
    <div className="modal-dialog" role="document">
      <div className="modal-content" style={{backgroundColor:'white'}}>
        <div className="modal-header">
          <h5 className="modal-title" id="contactModalLabel">Reach Out to Our Team</h5>
          <button
            type="button"
            className="btn-close"
            data-bs-dismiss="modal"
            aria-label="Close"
          ></button>
        </div>
        <div className="modal-body">
          <form>
            <div className="mb-3">
              <label htmlFor="name" className="form-label">Name</label>
              <input type="text" className="form-control" id="name" placeholder="Enter your name" required />
            </div>
            <div className="mb-3">
              <label htmlFor="email" className="form-label">Email</label>
              <input type="email" className="form-control" id="email" placeholder="Enter your email" required />
            </div>
            <div className="mb-3">
              <label htmlFor="number" className="form-label">Phone Number</label>
              <input type="number" className="form-control" id="number" placeholder="Enter Mobile Number" required />
            </div>
            <button type="submit" className="btn btn-primary">Submit</button>
          </form>
        </div>
      </div>
    </div>
  </div>
);

export default ContactUs;
